import React from 'react'

function MiComponente({rey,reses}) {

  return (
    <div>Hola {rey} come {reses} al dia</div>
  )
}
MiComponente.defaulProps={
    reser:"pocas",
    rey:"Rey God"
}

export default MiComponente
